import { BrowserRouter, Routes } from 'react-router-dom';
import styled from 'styled-components';
import Navbar from './componets/Navbar';
import Home from './pages/Home';

const Page = styled.div`
  display: flex;
`

function App() {
  return (
    <Page>

      <BrowserRouter>
        <Routes>
          <Route></Route>
        </Routes>
      </BrowserRouter>
      <Home />
    </Page>
  );
}

export default App;
